import Pictures from "../../picture/Pictures";
import BasicsContainer from "./elements/basics/BasicsContainer";
import "./leftPanel.scss";

function LeftPanel() {
  return (
    <div className="leftpanel">
      <div>
        <div className="picture">
          <Pictures />
        </div>
        <BasicsContainer />
      </div>
    </div>
  );
}

export default LeftPanel;
